// Match viewmodel class
define('matchViewModel',['knockout'], function (ko) {
    return function matchViewModel(homeTeam, awayTeam, date) {
        var self = this;

        self.homeTeam = ko.observable(homeTeam);
        self.homeScore = ko.observable();
        self.awayTeam = ko.observable(awayTeam);
        self.awayScore = ko.observable();

        self.date = ko.observable(date);
        self.time = ko.observable('12:00:00');
    };
});
// Team viewmodel class
define('teamViewModel',['knockout', 'matchViewModel'], function (ko, matchViewModel) {
    return function teamViewModel(name) {
        var self = this;

        self.name = ko.observable(name);
        self.matches = ko.observableArray();

        self.played = ko.computed(function () {
            return ko.utils.arrayFilter(self.matches(), function (match) {
                return match.homeScore() && match.awayScore();
            });
        }, self);

        self.won = ko.computed(function () {
            return 0;
        }, self);

        self.lost = ko.computed(function () {
            return 0;
        }, self);

        self.draws = ko.computed(function () {
            return 0;
        }, self);

        self.goalsFor = ko.computed(function () {
            return 0;
        }, self);

        self.goalsAgainst = ko.computed(function () {
            return 0;
        }, self);

        self.goalsDifference = ko.computed(function () {
            return 0;
        }, self);

        self.points = ko.computed(function () {
            return 0;
        }, self);
    };
});
var getCombinations = function (a, n) {
    var fn = function (n, src, got, all) {
        if (n === 0) {
            if (got.length > 0) {
                all[all.length] = got;
            }
            return;
        }
        for (var j = 0; j < src.length; j++) {
            fn(n - 1, src.slice(j + 1), got.concat([src[j]]), all);
        }
        return;
    };

    var all = [];
    fn(n, a, [], all);
    return all;
};
define("combinations", function(){});

// Category viewmodel class
define('categoryViewModel',['knockout', 'teamViewModel', 'matchViewModel', 'combinations'], function (ko, teamViewModel, matchViewModel) {
    return function categoryViewModel(name) {
        var self = this;       

        self.name = ko.observable(name);

        self.id = ko.computed(function() {
            return self.name().replace(' ','');
        }, this);

        self.date = ko.observable(new Date().toJSON().slice(0, 10));
        self.homeAndAway = ko.observable(false);
        self.teams = ko.observableArray([new teamViewModel()]);
        self.matches = ko.observableArray();

        self.removeTeam = function (team) {
            self.teams.remove(team);
        };

        self.addTeam = function () {
            self.teams.push(new teamViewModel());
        };

        self.generateFixture = function () {
            self.matches.removeAll();

            var teamCombinations = getCombinations(self.teams(), 2);

            ko.utils.arrayForEach(teamCombinations, function (teamCombination) {
                var match = new matchViewModel(teamCombination[0], teamCombination[1], self.date());
                teamCombination[0].matches.push(match);
                teamCombination[1].matches.push(match);
                self.matches.push(match);
            });

            if (self.homeAndAway()) {
                ko.utils.arrayForEach(teamCombinations, function (teamCombination) {
                    var match = new matchViewModel(teamCombination[1], teamCombination[0], self.date());
                    teamCombination[0].matches.push(match);
                    teamCombination[1].matches.push(match);
                    self.matches.push(match);
                });
            }
        };

        self.update = function () {
            self.matches.sort(function (left, right) {
                return left.date() == right.date() && left.time() == right.time() ? 0 :
                    left.date() != right.date() ?
                    (left.date() > right.date() ? 1 : -1) : (left.time() > right.time() ? 1 : -1);
            });            
        };      
    };
});
// App viewmodel class
define('appViewModel',['knockout', 'categoryViewModel'], function (ko, categoryViewModel) {
    return function appViewModel() {
        var self = this;

        self.admin = ko.observable('true');
        self.categories = ko.observableArray([new categoryViewModel('Category 1')]);

        self.addCategory = function () {
            self.categories.push(new categoryViewModel('Category ' + (self.categories().length + 1)));
        };
    };
});
